import React from "react";
import index from "../css/index.css";

const Preview = ({ personal}) => {

    return (
        personal.map((personalType) =>
            <div key={personalType.id}>
                <div className="preview-info">
                    <div className="text-info">
                        <label>Name: </label>
                        {personalType.name}    
                    </div>
                    <div className="text-info">
                        <label>Email: </label>
                        {personalType.email}   
                    </div>
                    <div className="text-info">
                        <label>Phone: </label>
                        {personalType.phone}
                    </div>
                </div>
            </div>
        )
    )
}

export default Preview;
